import React,{Component} from "react";

class AppMusic extends Component{
  render(){
    return(
      <div className="container">
        <div className ="row">
            <div className ="col-lg-6">
            <h3>Name:ABBA</h3>
            <div>Title:Dancing Queen</div>
            <img src = "https://api.deezer.com/artist/180/image" className ="float-left w-50"/>


            </div>

        </div>
        
      </div>
    
    )
  }
}

